import React from 'react';
import { Link } from 'react-router-dom';

const urlList = [
    { url: '/', linkName: 'Home' },
    { url: '/products', linkName: 'Products' },
]
function MainNavigation(props) {
    return (
        <header>
            <nav>
                <ul>
                    {urlList.map((u, i) => (
                        <li key={i}>
                            <Link to={u.url}>{u.linkName}</Link>
                        </li>))}
                </ul>
            </nav>
        </header>
    );
}

export default MainNavigation;
